import React from "react";
import { Box } from "@mui/material";
import './footer.scss';


const Footer = () => {
    return (
        <Box className='footer'>
            <Box className='footer-body'></Box>
            <Box className='footer-bottom'></Box>
        </Box>
    )
}

export default Footer;
